import { curry } from '../fn/curry';
import { isAsymmetricMatcher } from './is-asymmetric-matcher';
/** ... */
export const isJestEqual = curry((value, other) => value === other ||
    (isAsymmetricMatcher(value) && value.asymmetricMatch(other)) ||
    (isAsymmetricMatcher(other) && other.asymmetricMatch(value)), 2);
